/* eslint-disable */
/* tslint:disable */
// @ts-nocheck
import React, { ReactNode, HTMLAttributes } from 'react';
import { createComponent } from '../lib';
import type { JSX } from '@vime/core/dist/types';

import { 
  VmEmbed 
} from '@vime/core';

import { define } from '../lib';


define('vm-embed', VmEmbed);


export interface EmbedProps extends JSX.VmEmbed, HTMLAttributes<HTMLVmEmbedElement> {
  children?: ReactNode | ReactNode[]
};

export default createComponent<HTMLVmEmbedElement, EmbedProps>(
  'vm-embed',
  new Set(['embedSrc','mediaTitle','params','origin','preconnections','decoder']),
);
